import React from "react";
import { connect } from "react-redux";
import classNames from "classnames";
import { setActiveComponent, restart } from "../actions";
import Histogram from "./Histogram";


let intro = ["Here is your favorite car.", "Here are your top-5 favorite cars.", "Here are your top-10 favorite cars."]

function pickRandom(arr, n) {
  // Make a copy of the array
  const arrCopy = [...arr];
  if(arrCopy.length <= n)
    return arrCopy;
  // Shuffle array
  for (let i = arrCopy.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [arrCopy[i], arrCopy[j]] = [arrCopy[j], arrCopy[i]]; // ES6 array element swap
  }
  // Get sub-array of first n elements after shuffled
  return arrCopy.slice(0, n);
}


function downloadFile() {
  let data = "This is sample text for our file";

  let blob = new Blob([data], { type: 'text/plain' });
  let url = URL.createObjectURL(blob);
  let downloadLink = document.createElement('a');
  downloadLink.href = url;
  downloadLink.download = 'sample.txt'; // 指定下载文件及类型
  document.body.appendChild(downloadLink);
  downloadLink.click();
  document.body.removeChild(downloadLink);
}

// show the number of questions asked and the favourite car/remaining cars.
function Result({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  restart,
  scores
}) {
  let ths = [];
  attributes.forEach(([attr, config]) => {
    if (mask[attr]) {
      const th = <th key={attr}>{attr}</th>;
      ths.push(th);
    }
  });
  ths.push(<th key="chooseCheckbox" />);

  const trs = leftPoints.map((idx, i) => (
    <tr key={i} data-toggle="tooltip" title={labels[idx]}>
      {candidates[idx].map((x, j) => (
        <td key={j}>{x}</td>
      ))}
      <td key="chooseCheckbox" />
    </tr>

  ));


  const sss = scores.map((sid, i) => (
      <tr key={i} data-toggle="tooltip" title={labels[i]}>
        <td key={i}>{sid}</td>
      </tr>
  ));

  //top-1 points
  const top1 = []; top1.push(trs[0]);
  //obtain the index
  const top1small = []; const top1large = [];
  for(let i = 1; i < leftPoints.length; ++i)
  {
    if((scores[0] - scores[i])/scores[0] < 0.1)
      top1small.push(leftPoints[i]);
    else
      top1large.push(leftPoints[i]);
  }

  console.log(top1small.length);
  for(let i = 0; i < top1small.length; ++i)
    console.log(top1small[i]);

  const top1smallSample = pickRandom(top1small, 5);
  const top1largeSample = pickRandom(top1large, 5);
  for (let i = 0; i < top1largeSample.length; ++i)
    top1smallSample.push(top1largeSample[i]);
  const top1Samplewithbox = top1smallSample.map((idx, i) => (
      <tr key={i} data-toggle="tooltip" title={labels[idx]}>
        {candidates[idx].map((x, j) => (
            <td key={j}>{x}</td>
        ))}
        <td>
          <input type="checkbox" id={`myCheckbox${i}`} name={`myCheckbox${i}`} value="myValue" />
          <label htmlFor={`myCheckbox${i}`}>Prefer</label>
        </td>
      </tr>
  ));


  const top5 = [];
  for(let i = 0; i < 5; ++i)
    top5.push(trs[i]);

  const top10 = [];
  for(let i = 0; i < 10; ++i)
    top10.push(trs[i]);

  return (
  <div>
    <div className="justify-content-center">
      <h4>{intro[0]}</h4>
      <table k={1}
        className={classNames("table", "table-hover", {
          "table-fixed": trs.length > 7
        })}
        style={{
          maxWidth: "40rem",
          margin: "auto"
        }}
      >
        <thead>
          <tr>{ths}</tr>
        </thead>
        <tbody>{top1}</tbody>
      </table>
      <h5>
        Please compare your favorite car and the following cars <br />
        and indicate if you are interested in the following cars?
      </h5>
      <table
             className={classNames("table", "table-hover", {
               "table-fixed": trs.length > 7
             })}
             style={{
               maxWidth: "40rem",
               margin: "auto"
             }}
      >
        <thead>
        <tr>{ths}</tr>
        </thead>
        <tbody>{top1Samplewithbox}</tbody>
      </table>
      <div>
        <button
          type="button"
          className="btn btn-primary"
          style={{ width: "8rem" }}
          onClick={downloadFile}>
          Finish
        </button>
      </div>
    </div>
  </div>
  );
}

const mapStateToProps = ({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  scores
}) => ({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  scores
});

const mapDispatchToProps = dispatch => ({
  restart: () => {
    dispatch(setActiveComponent("Welcome"));
    dispatch(restart());
  }
});

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Result);
